export const CityItem = ({ name, temp }) => {
  return (
    <>
      <div class="card" style="width: 18rem;">
        <div class="card-body">
          <h5 class="card-title">{name}</h5>
        </div>
        <ul class="list-group list-group-flush">
          <li class="list-group-item">{temp}</li>
        </ul>
      </div>
    </>
  );
};
